const Footer = () => {
    return(
        <div className="wrapper row5">
            <div id="copyright" className="clear">
                <p className="fl_left">Product &copy; 2022 - 개인프로젝트 - <a href="#">김희준</a></p>
                <p className="fl_right">Git <a href="https://cafe.naver.com/moyaid" title="Cafe">https://github.com/heeJNa</a></p>
            </div>
        </div>
    )
}

export default Footer
